// src/Welcome.js
import React from 'react';

const Welcome = ({ onD3React, onQGIS }) => {
    return (
        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh' }}>
            <h1>Welcome</h1>
            <button onClick={onD3React} style={{ padding: '10px 20px', fontSize: '16px', marginTop: '20px' }}>
                D3.React App
            </button>
            <button onClick={onQGIS} style={{ padding: '10px 20px', fontSize: '16px', marginTop: '20px' }}>
                QGIS Map
            </button>
        </div>
    );
};

export default Welcome;
